column29:
Similar microfinance platforms are Kiva, Wokai and LendForpeace, but they are non-profit organizations and they allow lending to the micro-entrepreneurs directly through the MFI, solely focused in MENA on Palestine and some cases in Jordan, Lebanon and Iraq. MicroWorld.org, part of the PlaNet Finance Group, is a peer-to-peer platform that was launched 18 months ago in France. It has a similar model to Pi Slice, channeling funds from individual lenders and large companies to MFIs around the world, albeit so far with low penetration in MENA and so far only offering non-remunerated loans for individual lenders. Pi Slice and MicroWorld decided to bring together their experience and resources in the fields of technology, MFIs, and the MENA region to create a partnership that can bring a new form of social action to MENA.
Competitive advantage of Pi Slice: Pi Slice presents a new approach linking MENA MFIs in need of funding to investors wishing to provide finance to MFIs for social reasons. While understanding the concerns of such investors â€“such as transparency, accountability, sustainability, performance, risk, etc.-, along macro MENA drivers and the challenges of MFIs in MENA, Pi Slice achieves the following competitive advantages:
-	Pi Slice has the first-mover advantage;
-	Pi Slice operates in MENA, a market that is under-penetrated and under-funded for the Micro Finance industry that still lacks on regulations and transparency;
-	Pi Slice is an innovative business model supported by tier one strategic partners and a highly motivated and qualified team;
-	Pi Slice will be listing MFIs according to strict selection criteria ensuring transparency, investment and social performance, low risk, sustainability, outreach, etc. MFIs will have more accountability incentives to remain part of the Pi Slice network;
-	Pi Slice will ensure the money to be properly invested to MFIs that in turn lend to their customers, all this supported by the PlanetFinance group of companies;
-	Pi Slice will have its own technology system â€“ developed by MicroWorld.org - that allows users to easily navigate the site, and allows Pi Slice to monitor transactions, traffic, and control fraud;
-	Pi Slice will create a new sustainable and profitable CSR channel for corporations and institutions, and therefore new sources of funding for MFIs through CSR programs and individual investors.

column33:
Pi Slice will be in the business of assisting and advising Micro Finance Institutions on marketing micro finance schemes. It will operate a platform that allows individuals and businesses to finance projects of micro-entrepreneurs around the world by making loans. 
This advice may include generic advice, a statement, opinion or report. Other services would include:
-	Understanding the budgets and needs of prospective MFIs;
-	Advising MFIs on opportunities;
-	Assisting MFIs in identifying and selecting relevant prospective investors in the target region;
-	Assisting MFIs in organizing product road shows and marketing visits; and
-	Assisting MFIs in maintaining and enhancing their relationships with investors and prospective investors
Pi Slice will effectively be arranging credit for MFIs through approaching corporate investors as well as high net worth individuals. MFIs will remunerate Pi Slice for its services in return in accordance with any fee arrangement. The internet portal for corporate investors and high net worth individuals will include relevant financial and operating information on the MFIs, as well as detailed selection criteria, to facilitate the decisions of Lenders. Once the Lenders decide on which MFI they want to lend to, they can remit the funds directly to the chosen MFI who will then release the funds to their Customers. Loans will have a repayment period of 12 to 24 months. Once loans are repaid to the Lenders, they can decide whether they intend to relend. The interest that is earned by the MFIs on their onward lending to Customers varies depending on the country, and the Lenders will receive a return according to each MFI of their choice.

column50:
The Pi Slice web based platform plugs a long standing need of MFIs to source funds to Customers. It is also difficult for such institutions to provide transparency to the Lenders. Such institutions rely historically in MENA on donations, and donors are not always informed as to where the money is really going. Pi Slice acts as one-point-of-portal broker between Lenders and selected partner MFIs. The Pi Slice web based platform will provide detailed information to Lenders on selected partner MFIs, through their social and investment performance, risk, outreach, transparency, regulation, sustainability, etc. Pi Slice will also follow-up on a regular basis with the MFIs through relationships built with the MFI network.
The parties involved will follow these simple steps:
-	Step 1 â€“ Pi meets the Lender and then refers the Lender to the MFI; 
-	Step 2 â€“ Lender registers and creates an account: create an account by submitting an application  online or by downloading the forms in PDF format and submitting the completed forms to MFI; 
-	Step 3 â€“ Lender activates account: the activation instructions are sent to Lenderâ€™s email address once step 2 (registration) is complete; and
-	Step 4 â€“ Lender confirms identification: Upon activation, Lender will need to send in an ID Confirmation Form.
All the Lenders will follow these simple steps:	
-	Step 1 â€“ Lender views the micro finance projects via the web platform of Pi Slice;  
-	Step 2 â€“ Lender selects a project and gives the money to the MFI; 
-	Step 3 â€“ MFI passes the money to the Customer; and
-	Step 4 â€“ MFI pays the fee to Pi-Slice.
